import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'

import Nav from 'react-bootstrap/Nav';
import 'bootstrap/dist/css/bootstrap.min.css';

// Import components
import Photo from "./pages/Photo";
import Film from "./pages/Film";
import Contact from "./pages/Contact";

import './App.css';

let currentKey = 1;
function App() {
    return (
        <div className="App">
            <Router>
                <header className="App-header">
                    <div className="Logo-container">
                        <div className="Logo-text">
                            JONAH SAFFRAN PRODUCTIONS
                        </div>
                    </div>
                </header>
                <Nav justify variant="tabs">
                    <Nav.Item>
                        <Nav.Link href="/home" eventKey="1">Photography</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link href="/film" eventKey="2">Film</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link href="/contact" eventKey="3">Contact</Nav.Link>
                    </Nav.Item>
                </Nav>
                <Routes>
                    <Route exact path="/photo" element={<Photo />} />
                    <Route exact path="/film" element={<Film />} />
                    <Route exact path="/contact" element={<Contact />} />
                </Routes>
            </Router>
        </div>
    );
}
export default App;
